import React, { Component } from "react";

class UserPick extends Component {
  state = {
    users: ["123", "sam", "some name"]
  };
  render() {
    return (
      <div>
        <h4>Please select a user to login as:</h4>
        {this.state.users.map(user => (
          <h3>{user}</h3>
        ))}
      </div>
    );
  }
}

export default UserPick;
